        self.workspacePath = workspacePath
        self.vectorDbPath = vectorDbPath
        self.shell = shell
    }
}



extension AgentConfig: Equatable, Hashable {
    public static func ==(lhs: AgentConfig, rhs: AgentConfig) -> Bool {
        if lhs.workspacePath != rhs.workspacePath {
            return false
        }
        if lhs.vectorDbPath != rhs.vectorDbPath {
            return false
        }
        if lhs.shell != rhs.shell {
            return false
        }
        return true
    }

    public func hash(into hasher: inout Hasher) {
        hasher.combine(workspacePath)
        hasher.combine(vectorDbPath)
        hasher.combine(shell)
    }
}


