fileprivate struct FfiConverterSequenceTypeSearchResult: FfiConverterRustBuffer {
    typealias SwiftType = [SearchResult]

    public static func write(_ value: [SearchResult], into buf: inout [UInt8]) {
        let len = Int32(value.count)
        writeInt(&buf, len)
        for item in value {
            FfiConverterTypeSearchResult.write(item, into: &buf)
        }
    }

    public static func read(from buf: inout (data: Data, offset: Data.Index)) throws -> [SearchResult] {
        let len: Int32 = try readInt(&buf)
        var seq = [SearchResult]()
        seq.reserveCapacity(Int(len))
        for _ in 0 ..< len {
            seq.append(try FfiConverterTypeSearchResult.read(from: &buf))
        }
        return seq
    }
}

private enum InitializationResult {
    case ok
    case contractVersionMismatch
    case apiChecksumMismatch
}
// Use a global variable to perform the versioning checks. Swift ensures that
// the code inside is only computed once.
private var initializationResult: InitializationResult = {
    // Get the bindings contract version from our ComponentInterface
    let bindings_contract_version = 26
    // Get the scaffolding contract version by calling the into the dylib
    let scaffolding_contract_version = ffi_microcode_core_uniffi_contract_version()
    if bindings_contract_version != scaffolding_contract_version {
        return InitializationResult.contractVersionMismatch
    }
    if (uniffi_microcode_core_checksum_method_microcore_apply_edit() != 46628) {
        return InitializationResult.apiChecksumMismatch
    }
    if (uniffi_microcode_core_checksum_method_microcore_clear_index() != 15585) {
        return InitializationResult.apiChecksumMismatch
    }
    if (uniffi_microcode_core_checksum_method_microcore_execute_command() != 61054) {
        return InitializationResult.apiChecksumMismatch
    }
    if (uniffi_microcode_core_checksum_method_microcore_get_index_stats() != 55304) {
        return InitializationResult.apiChecksumMismatch
    }
    if (uniffi_microcode_core_checksum_method_microcore_index_project() != 25555) {
        return InitializationResult.apiChecksumMismatch
    }
    if (uniffi_microcode_core_checksum_method_microcore_read_file() != 20880) {
        return InitializationResult.apiChecksumMismatch
    }
    if (uniffi_microcode_core_checksum_method_microcore_semantic_search() != 16406) {
        return InitializationResult.apiChecksumMismatch
    }
    if (uniffi_microcode_core_checksum_method_microcore_write_file() != 50289) {
        return InitializationResult.apiChecksumMismatch
    }
    if (uniffi_microcode_core_checksum_constructor_microcore_new() != 17168) {
        return InitializationResult.apiChecksumMismatch
    }

    return InitializationResult.ok
}()

private func uniffiEnsureInitialized() {
    switch initializationResult {
    case .ok:
        break
    case .contractVersionMismatch:
        fatalError("UniFFI contract version mismatch: try cleaning and rebuilding your project")
    case .apiChecksumMismatch:
        fatalError("UniFFI API checksum mismatch: try cleaning and rebuilding your project")
    }
}

